import React from 'react';

const Result = (props) => {

    const{err, city, temp, date, sunrise, sunset, pressure, wind} = props.weather

    let content = null;

    if(!err && city){
        content = (
        <div>
            <h3>Wyniki wyszukiwania dla <strong>{city}</strong></h3>
            <h4>Dane dla dnia i godziny: {date}</h4>
            <h4>Aktualna temperatura: {temp}</h4>
        </div>
        )
    }

    return (
        <div className="result">
            {err ? `Nie mamy w bazie ${city}` :
            content}
        </div>


     );
}

export default Result;
